# This program draws the Interstate 65.
Ind_pol = get("Indiana", "STATE", "POLYGON")
display_shape(Ind_pol)
Ind_cross_flag=0
Iowa_pol = get("Iowa", "STATE", "POLYGON")
display_shape(Iowa_pol)
Iowa_cross_flag=0
I65= get("I- 65", "PRIMARY-ROAD", "POLYLINE")
for i in range(len(I65)):
  display_shape(I65[i])
  if(crosses(I65[i],Ind_pol)):
     Ind_cross_flag=1
  if (crosses(I65[i],Iowa_pol)):
     Iowa_cross_flag=1
if(Ind_cross_flag==1):
    print "I65 crosses Indiana"
else:
    print "I65 does not cross Indiana"
    
if(Iowa_cross_flag==1):
    print "I65 crosses Iowa"
else:
    print "I65 does not cross Iowa"|1|2|3|4|1|5|6|
